(30, 1, '2018-04-13 19:32:38', '2018-04-13 17:32:38', '&nbsp;\r\n<blockquote>This is a welcome page\r\n\r\nQuae dum ita struuntur, indicatum est apud Tyrum indumentum regale textum occulte, incertum quo locante vel cuius usibus apparatum. ideoque rector provinciae tunc pater Apollinaris eiusdem nominis ut conscius ductus est aliique congregati sunt ex diversis civitatibus multi, qui atrocium criminum ponderibus urgebantur.\r\n\r\nHaec subinde Constantius audiens et quaedam referente Thalassio doctus, quem eum odisse iam conpererat lege communi, scribens ad Caesarem blandius adiumenta paulatim illi subtraxit, sollicitari se simulans ne, uti est militare otium fere tumultuosum, in eius perniciem conspiraret, solisque scholis iussit esse contentum palatinis et protectorum cum Scutariis et Gentilibus, et mandabat Domitiano, ex comite largitionum, praefecto ut cum in Syriam venerit, Gallum, quem crebro acciverat, ad Italiam properare blande hortaretur et verecunde.</blockquote>', 'Welcome', '', 'publish', 'closed', 'closed', '', 'welcome', '', '', '2018-04-13 19:32:38', '2018-04-13 17:32:38', '', 0, 'http://localhost/wp_veniz/?page_id=30', 0, 'page', '', 0),
(31, 1, '2018-04-13 19:32:38', '2018-04-13 17:32:38', '&nbsp;\r\n<blockquote>This is a welcome page\r\n\r\nQuae dum ita struuntur, indicatum est apud Tyrum indumentum regale textum occulte, incertum quo locante vel cuius usibus apparatum. ideoque rector provinciae tunc pater Apollinaris eiusdem nominis ut conscius ductus est aliique congregati sunt ex diversis civitatibus multi, qui atrocium criminum ponderibus urgebantur.\r\n\r\nHaec subinde Constantius audiens et quaedam referente Thalassio doctus, quem eum odisse iam conpererat lege communi, scribens ad Caesarem blandius adiumenta paulatim illi subtraxit, sollicitari se simulans ne, uti est militare otium fere tumultuosum, in eius perniciem conspiraret, solisque scholis iussit esse contentum palatinis et protectorum cum Scutariis et Gentilibus, et mandabat Domitiano, ex comite largitionum, praefecto ut cum in Syriam venerit, Gallum, quem crebro acciverat, ad Italiam properare blande hortaretur et verecunde.</blockquote>', 'Welcome', '', 'inherit', 'closed', 'closed', '', '30-revision-v1', '', '', '2018-04-13 19:32:38', '2018-04-13 17:32:38', '', 30, 'http://localhost/wp_veniz/2018/04/13/30-revision-v1/', 0, 'revision', '', 0),
(32, 1, '2018-04-14 17:56:06', '2018-04-14 15:56:06', 'Voici un exemple de page. Elle est différente d’un article de blog, en cela qu’elle restera à la même place, et s’affichera dans le menu de navigation de votre site (en fonction de votre thème). La plupart des gens commencent par écrire une page « À Propos » qui les présente aux visiteurs potentiels du site. Vous pourriez y écrire quelque chose de ce tenant :\r\n<blockquote>&nbsp;</blockquote>\r\nÉtant donné que vous êtes un nouvel utilisateur ou une nouvelle utilisatrice de WordPress, vous devriez vous rendre sur votre <a href=\"http://localhost/wp_veniz/wp-admin/\">tableau de bord</a> pour effacer la présente page, et créer de nouvelles pages avec votre propre contenu. Amusez-vous bien !', 'Transport', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-04-14 17:56:06', '2018-04-14 15:56:06', '', 2, 'http://localhost/wp_veniz/2018/04/14/2-revision-v1/', 0, 'revision', '', 0),
